// src/components/AttackDetector.js
import React from 'react';
import { Link } from 'react-router-dom';
import './AttackDetector.css'; // Adjust if needed

function AttackDetector() {
  return (
    <div className="attack-detector-info">
      <h2>24/7 Attack Detector</h2>
      <p>This tool monitors your network around the clock, detecting unusual activities...</p>
      <p>Click the button below to go to the detailed Attack Detector dashboard:</p>
      <Link to="/network-detector" className="detector-button">Go to Detector Dashboard</Link>
    </div>
  );
}

export default AttackDetector;
